// SPDX-License-Identifier: MIT
pragma solidity ^0.8.21;

contract AdminCandidates {
    struct Candidate {
        string name;
        string party;
        string position;
        uint256 votes;
    }

    mapping(string => Candidate[]) private candidates;
    string[] private positionList;

    address public admin;
    bool public isFinalized = false;

    event CandidatesSubmitted();
    event CandidatesReset();
    event VoteSubmitted(string position, string name);

    modifier onlyAdmin() {
        require(msg.sender == admin, "Only admin can perform this action");
        _;
    }

    constructor() {
        admin = msg.sender;
    }

    function submitCandidates(
        string[] calldata _positions,
        string[][] calldata _names,
        string[][] calldata _parties
    ) external onlyAdmin {
        require(!isFinalized, "Candidates are already finalized!");
        delete positionList;
        uint256 positionsLength = _positions.length;
        for (uint256 i = 0; i < positionsLength; ) {
            // If no candidates exist for this position, add it to the list
            if (candidates[_positions[i]].length == 0) {
                positionList.push(_positions[i]);
            }
            // Clear previous candidates for that position
            delete candidates[_positions[i]];
            uint256 namesLength = _names[i].length;
            for (uint256 j = 0; j < namesLength; ) {
                candidates[_positions[i]].push(Candidate({
                    name: _names[i][j],
                    party: _parties[i][j],
                    position: _positions[i],
                    votes: 0
                }));
                unchecked { ++j; }
            }
            unchecked { ++i; }
        }
        isFinalized = true;
        emit CandidatesSubmitted();
    }

    function batchVote(
        string[] calldata _positions,
        uint256[] calldata _indices
    ) external {
        require(isFinalized, "Voting cannot start until candidates are finalized!");
        require(_positions.length == _indices.length, "Mismatched input lengths");
        uint256 length = _positions.length;
        for (uint256 i = 0; i < length; ) {
            candidates[_positions[i]][_indices[i]].votes++;
            emit VoteSubmitted(_positions[i], candidates[_positions[i]][_indices[i]].name);
            unchecked { ++i; }
        }
    }

    function getCandidates(string calldata _position) external view returns (Candidate[] memory) {
        return candidates[_position];
    }

    function getVoteCounts() external view returns (Candidate[] memory) {
        uint256 totalCandidates;
        uint256 posCount = positionList.length;
        for (uint256 i = 0; i < posCount; ) {
            totalCandidates += candidates[positionList[i]].length;
            unchecked { ++i; }
        }

        Candidate[] memory allCandidates = new Candidate[](totalCandidates);
        uint256 index = 0;
        for (uint256 i = 0; i < posCount; ) {
            Candidate[] storage positionCandidates = candidates[positionList[i]];
            uint256 candidateCount = positionCandidates.length;
            for (uint256 j = 0; j < candidateCount; ) {
                allCandidates[index] = positionCandidates[j];
                index++;
                unchecked { ++j; }
            }
            unchecked { ++i; }
        }
        return allCandidates;
    }

    function resetCandidates() external onlyAdmin {
        uint256 posCount = positionList.length;
        for (uint256 i = 0; i < posCount; ) {
            delete candidates[positionList[i]];
            unchecked { ++i; }
        }
        delete positionList;
        isFinalized = false;
        emit CandidatesReset();
    }
}

